import '../Footer/Footer.css'

const Footer = () => {
  return (
    <div>
          <footer className="bg-primary pt-5  align-self-end 
          bottom-0 end-0 ">
      <div className="container">
        <p className="lead text-white text-align-center">Copyright &copy; 2023 NPM TEAM</p>
        <a href="" className="position-absolute bottom-0 end-0 p-5">
          <i className="bi bi-arrow-up-circle h1"></i>
        </a>
      </div>
    </footer>
    </div>
  );
};

export default Footer;
